import React from 'react';

function Collect() {
  let url = 'https://gateway.pinata.cloud/ipfs/QmU5bwaw1crBiUcbRmFCwQHkHJX9bM2fA3hC1uaEiVvSdP';

fetch(url)
.then(res => res.json())
.then((out) => {
  console.log('Checkout this JSON! ', out);
})
.catch(err => { throw err });

  return (
    <div className="App">
      {out}
    </div>
  );
}

export default Collect;
